import react,{Component} from 'react'
import {BrowserRouter as Router, Route, Link} from 'react-router-dom'

import PageWrapper from './components/PageWrapper'
import Home from './components/Pages/Home'

function App() {
  return (
    <Router>
    <PageWrapper>
      <Route>
        path = "/home"
        component={Home}
      </Route>
      </PageWrapper>

      </Router>
  );
}

export default App;
